Gree + brings you a brand new experience for intelligent control. As a new official application software that Gree  develops specially for IoT era, it has the functions of appliances management, intelligent control, etc., which makes your life much easier.  

Function introductions:
1、Intelligent products can be easily added into Gree ecosystem for intelligent management uniformly;
2、You can control the appliance at anytime and anywhere you like;
3、You can know the status of the appliance in real time and all changes of appliance status will be reported to you immediately。

Turn your iPhone or iPad into the wireless flash drive for your Mac. Have full access to your Mac files – use your iOS device to stream videos, view photos and documents, from anywhere within your home.

AT A GLANCE
- Stream any video directly from your Mac;
- View photos or documents stored on your Mac;
- Transfer files between your Mac and your iOS device;
- Store anything on your iOS device and take it with you on the go;
- Mount your iOS device as drive on your Mac or Windows machine using WebDAV;
- Use the Personal Hotspot of your iOS device to control your Mac when you don’t have access to other networks.

SYSTEM REQUIREMENTS
- Mac with macOS 10.10 or above and Helper app installed;
- iPhone, iPad or iPod touch with iOS 11 or above;
- Shared wireless network connection between your computer and iOS device.

